import axios from "axios";

const baseURL = "https://tv-api.com/en/API/Top250TVs/k_12345678";

export const fetchData = async () => {
  try {
    const response = await axios.get(baseURL);
    return response.data;
  } catch (error) {
    throw error;
  }
};
